def can_tile_board(n, board):
    padded_board = [['#'] * (n + 2)]
    for row in board:
        padded_board.append(['#'] + list(row) + ['#'])
    padded_board.append(['#'] * (n + 2))

    def place_piece(i, j):
        if padded_board[i + 1][j] == '.' and padded_board[i + 1][j - 1] == '.' and (padded_board[i + 1][j + 1] == '.') and (padded_board[i + 2][j] == '.'):
            padded_board[i + 1][j] = '#'
            padded_board[i + 1][j - 1] = '#'
            padded_board[i + 1][j + 1] = '#'
            padded_board[i + 2][j] = '#'
            return True
        return False
    for i in range(1, n + 1):
        for j in range(1, n + 1):
            if padded_board[i][j] == '.':
                if not place_piece(i, j):
                    return False
    return False

